Thank you for your interest in Austin.&nbsp; He is a courtesy post and is not in foster care with us.&nbsp; Please contact his foster mom Tina at: tinastone28@gmail.com or 240-434-5308 for more information or to schedule a meeting with him.
Austin is a 6 year old mixed breed, medium sized dog, who is friendly, loyal and makes new friends easily. He loves to play catch, go for walks, and chase the water in sprinklers. He loves bacon treats and is very well mannered. Austin is looking for a new home because his previous owner was elderly and unable to care for him. He has been fostering with a family member who has 3 dogs and 3 kids, and he gets along great with all of them.&nbsp; Austin is up to date on all his shots, neutered, good on leash, and house trained.&nbsp;
